import React from 'react';
import { Text } from 'react-native';
import { TouchableOpacity, View } from 'react-native';

export default <Text>
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        {isLoggedIn === true ? <TouchableOpacity onPress={logUserOut}><AntDesign name="staro" size={48} color="black" /></TouchableOpacity>
            :
            <TouchableOpacity onPress={logUserIn}><AntDesign name="star" size={48} color="black" /></TouchableOpacity>}
    </View>
</Text>
